void copyCharMatrixArray(char (&arrayA)[ARRAY_SIZE][MAX_CHAR], const char (&arrayB)[ARRAY_SIZE][MAX_CHAR])
{
    memcpy(arrayA, arrayB, sizeof(arrayB));
}

